create table clients (
	account_number INT NOT NULL,
	username VARCHAR(20) NOT NULL PRIMARY KEY,
	password VARCHAR(60) NOT NULL,
	name VARCHAR(50) NOT NULL,
	ci INT NOT NULL,
	account_type VARCHAR(7) NOT NULL,
	balance DECIMAL(12,2) NOT NULL,
	last_transaction VARCHAR(20) REFERENCES transactions (username) ,
	suspended BOOLEAN NOT NULL
);

-- Add a check constraint to ensure last_transaction is either NULL or equal to username
ALTER TABLE clients
ADD CONSTRAINT check_last_transaction
CHECK (last_transaction IS NULL OR last_transaction = username);

